import React, { useState } from "react";

const Home = () => {
  const [location, setLocation] = useState("");
  const [startDate, setStartDate] = useState("");
  const [endDate, setEndDate] = useState("");

  return (
    <div
      className="relative h-[85vh] bg-cover bg-center flex items-center justify-center"
      style={{
        backgroundImage: `url('https://images.pexels.com/photos/1571460/pexels-photo-1571460.jpeg')`,
      }}
    >
      {/* Overlay */}
      <div className="absolute inset-0 bg-black opacity-50"></div>

      {/* Content */}
      <div className="relative text-center text-white px-6">
        <h1 className="text-4xl md:text-6xl font-bold mb-4">
          Your Property, Our Priority
        </h1>
        <p className="text-lg md:text-xl mb-6">
          Find perfect homes, luxury villas, and rental spaces in seconds.
        </p>

        {/* Search Box */}
        <div className="bg-white p-4 rounded-lg shadow-lg flex flex-col md:flex-row gap-4 items-center">
          
          {/* Location */}
          <input
            type="text"
            placeholder="Enter Location..."
            value={location}
            onChange={(e) => setLocation(e.target.value)}
            className="border rounded p-2 w-full md:w-48 text-black"
          />

          {/* Start Date */}
          <input
            type="date"
            value={startDate}
            onChange={(e) => setStartDate(e.target.value)}
            className="border rounded p-2 w-full md:w-48 text-black"
          />

          {/* End Date */}
          <input
            type="date"
            value={endDate}
            onChange={(e) => setEndDate(e.target.value)}
            className="border rounded p-2 w-full md:w-48 text-black"
          />

          {/* Search Button */}
          <button className="bg-blue-600 text-white px-6 py-2 rounded hover:bg-blue-700 transition">
            Search Property
          </button>
        </div>
      </div>
    </div>
  );
};

export default Home;
